// ADD ROUTER TO CANVAS FUNC
const addRouter = (x, y, name, status) => {
  const icon = status ? routerIconUrl : routerOfflineIconUrl;
  const routerName = new fabric.Text(name, {
    fontSize: 20,
    fontWeight: "bold",
    left: x,
    top: y - 50,
    originX: "center",
    originY: "center",
    fill: "#01a0e9",
    stroke: "#fff",
    strokeWidth: 10,
    paintFirst: "stroke",
  });
  const routerImage = new fabric.Image.fromURL(icon, (img) => {
    img.set({
      width: 64,
      height: 64,
      left: x,
      top: y,
      originX: "center",
      originY: "center",
    });
    let routerGroup = new fabric.Group([routerName, img], {
      left: x,
      top: y,
      angle: 0,
      originX: "center",
      originY: "center",
    });
    canvas.add(routerGroup);
  });
  canvas.renderAll();
};

// DELETE ROUTER
let rmRouter = () => {
  var activeObject = canvas.getActiveObjects();
  if (confirm("Вы уверены, что хотите удалить роутер со схемы?")) {
    canvas.discardActiveObject();
    canvas.remove(...activeObject);
    routersCount++;
  }
};

